(2, 'About Us', 'about-us', '<h1><a name=\"what\">What is surfcity.com</a></h1>\r\n\r\n<p>Surfcity.com (Innovative Retail Concepts Private Limited) is India&rsquo;s largest online food and grocery store. With over 18,000 products and over a 1000 brands in our catalogue you will find everything you are looking for. Right from fresh Fruits and Vegetables, Rice and Dals, Spices and Seasonings to Packaged products, Beverages, Personal care products, Meats &ndash; we have it all.<br />\r\nChoose from a wide range of options in every category, exclusively handpicked to help you find the best quality available at the lowest prices. Select a time slot for delivery and your order will be delivered right to your doorstep, anywhere.</p>\r\n\r\n<p>You can pay online using your debit / credit card or by cash on delivery.<br />\r\nWe guarantee on time delivery, and the best quality! You can pay online using your debit / credit card or by cash on delivery.<br />\r\nWe guarantee on time delivery, and the best quality!</p>', 0, 0, 1, '2019-03-28 04:39:58'),
