o has agreed to become a buyer or customer on the Platform by providing Registration Data while registering on the Platform as a registered user using any computer systems. The terms &ldquo;Surfcity&rdquo;, &ldquo;we&rdquo;, &ldquo;us&rdquo; or &ldquo;our&rdquo; shall mean SURFCITY. III. Surfcity enables transactions between participant restaurants/merchants and buyers, dealing in prepared food and beverages (&ldquo; Platform Services&rdquo;). The buyers (&ldquo;Buyer/s&rdquo;) can choose and place orders (&ldquo; Orders&rdquo;) from variety of products listed and offered for sale by various neighbourhood merchants including but not limited to the restaurants and eateries (&ldquo; Merchant/s&rdquo;), on the Platform and Surfcity enables delivery of such orders at select localities of serviceable cities across India (&ldquo; Delivery Services&rdquo;). The Platform Services and Delivery Services are collectively referred to as &ldquo; Services&rdquo;. IV.</p>\r\n\r\n<p><strong>AMENDMENTS </strong></p>\r\n\r\n<p>These Terms of Use are subject to modifications at any time. We reserve the right to modify or change these Terms of Use and other Surfcity policies at any time by posting changes on the Platform, and you shall be liable to update yourself of such changes, if any, by accessing the changes on the Platform. You shall, at all times, be responsible for regularly reviewing the Terms of Use and the other Surfcity policies and note the changes made on the Platform. Your continued usage of the services after any change is posted constitutes your acceptance of the amended Terms of Use and other Surfcity policies. As long as you comply with these Terms of Use, Surfcity grants you a personal, non-exclusive, non-transferable, limited privilege to access, enter, and use the Platform. By accepting these Terms of Use, you also accept and agree to be bound by the other terms and conditions and Surfcity policies (including but not limited to Cancellation &amp; Refund Policy, Pr